import React from "react";
import SearchBar from "../SEARCHBAR/SearchBar.jsx";
import s from "../NAVBAR/NavBar.module.css"
import { Link, NavLink } from "react-router-dom";

export default  function  NavBar({onSearch, setAccess}){
    return (
        <div className={s.contenedor}>
         <div className={s.navbar}>
           
            <div className={s.botones}>
            <NavLink activeClassName={s.link} to="/about"><button className={s.about}> About </button></NavLink>
            <Link to="/home"><button  className={s.home}> Home </button></Link>
            <button onClick={(e) => {setAccess(false);}} className={s.logout}> Logout </button>
            </div>
            <div className={s.searchBar}>
            <SearchBar onSearch={onSearch}/>
            </div>
          </div>
        </div>
    )
}
